    // 筛序集合竞价板
    // 股票代码，名称，当前价，买一申请，买一报价， 卖一申请，卖一报价，成交金额，浮动值
    var candidateSharesData = [];
    let maxGpNum = realSharesData.length;
    for (let i=0;i<maxGpNum;i++)
    {
        let ctElements = realSharesData[i][0].split(",");
        // 价格过低或过高
        if(ctElements[3] < 2 || ctElements[3] > 20){
            continue;
        }

        if(ctElements[0] == ''){
            continue;
        }

        if(ctElements[10] == 'NaN' || ctElements[11] == 'NaN' || ctElements[20] == 'NaN' || ctElements[21] == 'NaN' || ctElements[9] == 'NaN')
        {
            continue;
        }
        let priceRadio = ((ctElements[3] - ctElements[2])/ctElements[2])*100;
        if(priceRadio < 3)
        {
            continue;
        }

        var ctSingleCandidateSharesData = [];
        ctSingleCandidateSharesData.push(realSharesData[i][1]); // 股票代码
        ctSingleCandidateSharesData.push(ctElements[0]); // 当前名称
        ctSingleCandidateSharesData.push(ctElements[3]); // 当前价
        ctSingleCandidateSharesData.push(ctElements[10]/100); // 买一申请
        ctSingleCandidateSharesData.push(ctElements[11]); // 买一报价
        ctSingleCandidateSharesData.push(ctElements[20]/100); // 卖一申请
        ctSingleCandidateSharesData.push(ctElements[21]); // 卖一报价
        ctSingleCandidateSharesData.push(ctElements[9]/10000.0); // 成交金额
        ctSingleCandidateSharesData.push(priceRadio); // 浮动值
        candidateSharesData.push(ctSingleCandidateSharesData);
    }

    // 按浮动值排序
    candidateSharesData.sort(function (a,b) {
            if (a[8] < b[8] ) {           // 按某种排序标准进行比较, a 小于 b
                return 1;
            }
            if (a[8] > b[8] ) {
                return -1;
            }
            // a must be equal to b
            return 0;
        });

    // 输出
    let outputTextArea = document.querySelector('#outputInfoArea');

    for(let j=0;j<candidateSharesData.length;j++)
    {
        if(candidateSharesData[j][1] == '')
        {
            continue;
        }

        if(candidateSharesData[j][8] == 'NaN')
        {
            continue;
        }

        outputTextArea.value = outputTextArea.value +
                candidateSharesData[j][0] + ',  ' +
                candidateSharesData[j][1] + ',  ' +
                '当前价：' + Math.floor(candidateSharesData[j][2]*100)/100. + '元' + ',  ' +
                // '买一：' + Math.floor(candidateSharesData[j][3]) + '百手' + ',  ' +
                // '买一：' + Math.floor(candidateSharesData[j][4]*100)/100. + '元' + ',  ' +
                // '卖一：' + Math.floor(candidateSharesData[j][5]) + '百手' + ',  ' +
                // '卖一：' + Math.floor(candidateSharesData[j][6]*100)/100. + '元' + ',  ' +
                // '成交金额：' + Math.floor(candidateSharesData[j][7]) + '万元' + ',  ' +
                '当前浮动值：' + Math.floor(candidateSharesData[j][8]*100)/100. + '%' + ',  ' +
                '\n';
    }
